import React, { useState } from "react";
import InputField from "./InputField"; // Make sure the path matches your file structure

const App = () => {
  const [inputValue, setInputValue] = useState("");

  const handleChange = (e) => {
    setInputValue(e.target.value);
  };

  return (
    <div>
      <h2>Reusable Input Field Component</h2>
      <InputField
        type="text"
        placeholder="Enter some text"
        value={inputValue}
        onChange={handleChange}
      />
    </div>
  );
};

export default App;
